CREATE TABLE `staff` (
  `name` varchar(100) default NULL,
  `age` varchar(100) default NULL,
  `sex` varchar(100) default NULL,
  `address` varchar(100) default NULL,
  `depart` varchar(100) default NULL,
  `worklen` varchar(100) default NULL,
  `wage` varchar(100) default NULL
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

/*Data for the table `staff` */

insert  into `staff`(`name`,`age`,`sex`,`address`,`depart`,`worklen`,`wage`) values ('Tom1','32','M','china','Personnel','3','3000');

/*Table structure for table `student` */

DROP TABLE IF EXISTS `student`;

CREATE TABLE `student` (
  `ID` varchar(32) NOT NULL default '' COMMENT '主键',
  `NAME` varchar(32) default NULL COMMENT '用户名',
  `age` int(11) default NULL COMMENT '年龄',
  `SALARY` decimal(10,2) default NULL COMMENT '工资',
  `createDt` datetime default NULL COMMENT '创建时间',
  PRIMARY KEY  (`ID`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

/*Data for the table `student` */

/*Table structure for table `systemlink` */

DROP TABLE IF EXISTS `systemlink`;

CREATE TABLE `systemlink` (
  `id` varchar(32) default NULL COMMENT '主键',
  `name` varchar(500) default NULL COMMENT '系统名称',
  `url` varchar(1000) default NULL COMMENT '链接地址',
  `remark` varchar(1000) default NULL COMMENT '备注',
  `type` varchar(10) default NULL COMMENT '链接方式0为弹出窗口1为跳转'
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

/*Data for the table `systemlink` */

insert  into `systemlink`(`id`,`name`,`url`,`remark`,`type`) values ('402847c249dc484f0149dc5ce92b0039','百度','http://www.baidu.com','1','0');

/*Table structure for table `t_s_attachment` */

DROP TABLE IF EXISTS `t_s_attachment`;

CREATE TABLE `t_s_attachment` (
  `id` varchar(32) NOT NULL COMMENT '主键ID',
  `userid` varchar(32) default NULL COMMENT '用户ID',
  `businesskey` varchar(32) default NULL,
  `infotypeid` varchar(32) default NULL COMMENT '类型ID',
  `attachmenttitle` varchar(100) default NULL,
  `realpath` varchar(100) default NULL COMMENT '附件路径',
  `subclassname` text,
  `createdate` datetime default NULL,
  `attachmentcontent` longblob COMMENT '附件内容',
  `swfpath` text COMMENT 'flash路径',
  `note` text,
  `extend` varchar(32) default NULL,
  `busentityname` varchar(100) default NULL,
  PRIMARY KEY  (`id`),
  UNIQUE KEY `IDX_ATTACHMENT` (`id`),
  KEY `FK1BC1BE5A99CDB413` (`userid`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

/*Data for the table `t_s_attachment` */

