/*Table structure for table `t_s_config` */

DROP TABLE IF EXISTS `t_s_config`;

CREATE TABLE `t_s_config` (
  `id` varchar(32) NOT NULL COMMENT '主键ID',
  `userid` varchar(32) default NULL COMMENT '用户ID',
  `code` varchar(100) default NULL COMMENT '编码',
  `name` varchar(100) NOT NULL COMMENT '配置名称',
  `content` text COMMENT '参数内容，  可以是 配置项，也可以是文件路径',
  `note` text COMMENT '备注',
  PRIMARY KEY  (`id`),
  UNIQUE KEY `IDX_CONFIG` (`id`),
  KEY `IDX_FOREIGN_USER` (`userid`),
  KEY `FKB1831BF999CDB413` (`userid`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

