  `id` varchar(32) NOT NULL COMMENT '主键ID',
  `iconid` varchar(32) default NULL COMMENT '图标ID',
  `functionid` varchar(32) default NULL COMMENT '菜单ID',
  `operationname` varchar(50) default NULL COMMENT '操作名称',
